import React from "react";
import "./Education.css";

const Education = () => {
  return (
    <div className="eduContainer">
      <p>I'm</p>
      <div className="degree">
        <p>

        pursuing B.Tech in the department of Computer Science and Engineering at Sri
        Vasavi Engineering College, Tadepalligudem
        </p>
      </div>
      <div className="inter">
        Completed +2 qualification in the stream of MPC from Sri Chaitanya Boys Jr.
        College, Vijayawada
      </div>
      <div className="ssc">Secondary Schooling at MSRZP High school, Ananthapalli</div>
    </div>
  );
};

export default Education;
